import Link from 'next/link'
function EmploymentHistory(props){
	let content = Object.keys(props.children).map(key => {
		const stat = () => {
			if(props.children[key].faculty_employment_position.employmentType == 'ftt')
				console.log('ftt')
				return "Full-time (Temporary)"
			if(props.children[key].faculty_employment_position.employmentType == 'ftp')
				return "Full-time (Permanent)"
			else(props.children[key].faculty_employment_position.employmentType == 'pt')
				return "Part-time"
		}
		return (
			<tr>
				<td>{props.children[key].faculty_employment_position.position}</td>
				<td>{stat}</td>
				<td>{props.children[key].startDate}</td>
				<td>{props.children[key].endDate}</td>
			</tr>
		);
	});

	return(
		<div>
			<div>
			<table className = "table table-striped table-sm">
				<tbody>
					<tr>
						<th>Position</th>
						<th>Type</th>
						<th>Start Date</th>
						<th>End Date</th>
					</tr>
					{content}
				</tbody>
			</table>
			</div>
		</div>
	)
}

export default EmploymentHistory
